import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  appBar: {
    backgroundColor: '#2196f3', // Bright blue background color
    boxShadow: theme.shadows[4], // Subtle shadow for elevation
  },
  toolbar: {
    display: 'flex',
    justifyContent: 'space-between', // Align items with space between
    padding: theme.spacing(1, 2), // Add padding for better spacing
  },
  title: {
    color: '#ffffff', // White color for the text
    flexGrow: 1,
    textAlign: 'center', // Center align the text
    fontWeight: 'bold', // Make the text bold
  },
  button: {
    marginLeft: theme.spacing(2), // Space between buttons
    color: '#ffffff', // White text color for the button
    borderColor: '#ffffff', // White border color
    '&:hover': {
      backgroundColor: '#1976d2', // Darker blue on hover
      borderColor: '#ffffff',
    },
  },
}));

export default function Appbar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" className={classes.appBar}>
        <Toolbar className={classes.toolbar}>
          <Typography variant="h6" className={classes.title}>
            Spring Boot React Full Stack Application
          </Typography>
          <Button variant="outlined" className={classes.button}>
            Login
          </Button>
          <Button variant="outlined" className={classes.button}>
            Sign Up
          </Button>
        </Toolbar>
      </AppBar>
    </div>
  );
}
